import React from "react";
import styles from "../styles/Main.module.css";

const About = () => {
  return (
    <section className={styles.about}>
      <div className={styles.about__content}>
        <h1 className={styles.about__title}>О компании СТО «Роял Сервис»</h1>
        <h2 className={styles.about__under_title}>
          Дата основания СТО «Роял Сервис»: 6 ноября 1996 года - 23 года на
          рынке автосервиса.
        </h2>
        <h2 className={styles.about__under_title}>
        Сфера деятельности:
        </h2>
        <p className={styles.about__text}>
        Ремонт и техническое обслуживание легковых автомобилей, внедорожников и микроавтобусов.
        </p>
        <h2 className={styles.about__under_title}>
        Наши клиенты:
        </h2> 
        <p className={styles.about__text}>
        Владельцы частного и коммерческого автотрансопрта - европейского, японского, корейского, и американского производства.        </p>
        <h2 className={styles.about__under_title}>
        Основные услуги которые мы предоставляем:
        </h2> 
        <ul>
           <li>Диагностика и ремонт ходовой части автомобиля;</li>
           <li>Проведение плановых ТО;
</li>
           <li>Капитальный и частичный ремонт двигателей;
</li>
           <li>3D Развал-схождение на стенде (HUNTER);
</li>
           <li>Услуги автоэлектрика;
</li>
           <li>Чистка инжектора;
</li>
           <li>Заправка и обслуживание автокондиционера;
</li>
           <li>Установка газового оборудования (ГБО);
</li>
           <li>А так же многие другие работы
</li>
        </ul>
        <h2 className={styles.about__under_title}>
        Дополнительный сервис:
        </h2> 
        <ul>
            <li>Удобный способ оплаты: наличными, с помощью терминала и безналичный;
</li>
            <li>Свободный доступ в зону проведения ремонта;
</li>
            <li>Видеонаблюдение всей територии сервиса;
</li>
            <li>Благоустроенная комната отдыха с ТВ и зоной Wi-Fi;
</li>
            <li>Постоянное наличие огромного ассортимента запчастей;
</li>
        </ul>
        <h2 className={styles.about__under_title}>
        Адрес автосервиса:
        </h2> 
        <p className={styles.about__text}>г.Киев ул.Радищева, 7

</p>
      </div>
    </section>
  );
};

export default About;
